<!DOCTYPE html>
<html>
    <body>
        <div id='container' ></div>
        <script src='https://rawgithub.com/mrdoob/three.js/master/build/three.min.js' ></script>
	<script>
var camera, scene, renderer;

var textureImage1 = new Image();
var textureImage2 = new Image();

init();
animate();

function init() {

  scene = new THREE.Scene();

  camera = new THREE.PerspectiveCamera(50, window.innerWidth / window.innerHeight, 1, 10000);
  camera.position.z = 500;
  camera.lookAt(new THREE.Vector3(0, 3, 0));
  scene.add(camera);

  var light = new THREE.DirectionalLight(0x555555, 1.6);
  light.position = new THREE.Vector3(0.577, 0.577, 0.577);
  light.castShadow = true;
  scene.add(light);

  // テクスチャ生成
  var texture1 = createTexture(textureImage1);
  var texture2 = createTexture(textureImage2);

  // マテリアル生成
  /*
  THREE.NoBlending
	THREE.NormalBlending
	THREE.AdditiveBlending
	THREE.SubtractiveBlending
	THREE.MultiplyBlending
	THREE.CustomBlending
  */
  var material1 = createTexturedMaterial(texture1, THREE.NormalBlending); // 通常のアルファ合成
  var material2 = createTexturedMaterial(texture2, THREE.NoBlending); // 合成無し

  // 手前に半透明の板を置く
  var geometry1 = new THREE.PlaneGeometry(1, 1, 10, 10); // 分割数が極端に小さいとperspective correctionが効かないのでテクスチャが割れるので10, 10にしておく
  var mesh1 = new THREE.Mesh(geometry1, material1);
  mesh1.rotation.set(-Math.PI / 8, Math.PI / 8, Math.PI / 8);
  mesh1.scale.x = mesh1.scale.y = 300;
  scene.add(mesh1);

  // 奥に不透明の板を置く
  var geometry2 = new THREE.PlaneGeometry(1, 1, 10, 10); // 分割数が極端に小さいとperspective correctionが効かないのでテクスチャが割れるので10, 10にしておく
  var mesh2 = new THREE.Mesh(geometry2, material2);
  mesh2.rotation.set(-Math.PI / 8, Math.PI / 8, Math.PI / 8);
  mesh2.scale.x = mesh2.scale.y = 300;
  mesh2.translateZ(-1);
  scene.add(mesh2);

  renderer = new THREE.WebGLRenderer({antialias: true});
  renderer.setSize(window.innerWidth, window.innerHeight);
  renderer.setClearColor(0xFFFFFF, 1);
  document.body.appendChild(renderer.domElement);

}

function animate() {

  requestAnimationFrame(animate);
  render();

}

function render() {
  renderer.render(scene, camera);
}

function createTexture(textureImage) {
  var texture = new THREE.Texture();
  texture.image = textureImage;
  textureImage.onload = function() {
    texture.needsUpdate = true;
  };
  //texture.repeat.set(1, 1);
  texture.wrapS = texture.wrapT = THREE.MirroredRepeatWrapping;
  return texture;
}

function createTexturedMaterial(texture, blend) {
  var isTransparent = blend == THREE.NoBlending ? false : true;
  var material = new THREE.MeshBasicMaterial({
    color: 0xffffff,
    map: texture,
    blending: blend,
    transparent: isTransparent
      //, depthTest: false
  });
  return material;
}
